sys_variable_value.value:
(function execute(inputs, outputs) {
    if (!inputs.spreadsheet || inputs.spreadsheet.trim() == "")
        throw "Provide Spreadsheet ID";
    if (!inputs.sheet || inputs.sheet.trim() == "")
        throw "Provide Sheet";
    if (!inputs.range || inputs.range.trim() == "")
        throw "Provide Range";
    outputs.spreadsheet = inputs.spreadsheet.trim();
	outputs.range = encodeURIComponent(inputs.sheet.trim()) + "!" + inputs.range.trim();
  	var payload = {
        values: []
    };
    try {
        for (var i = 0; i < inputs.values.length; i++) {
            payload.values.push(JSON.parse(inputs.values[i]));
        }
    } catch (e) {
        throw "Provide valid Values"+e;
    }
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

